import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

export default function VolunteerRegistration(){
    const navigate = useNavigate();
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [name, setName] = useState('');
    const [age, setAge] = useState('');
    const [address, setAddress] = useState('');
    const [contact, setPhone] = useState('');
    const [location, setLocation] = useState('');
    const [mon, setMon] = useState('');
    const [tues, setTues] = useState('');
    const [wed, setWed] = useState('');
    const [thurs, setThurs] = useState('');
    const [fri, setFri] = useState('');
    const [sat, setSat] = useState('');
    const [sun, setSun] = useState('');
    const [error, setError] = useState('');

    const handleAdminRegister = () => {
        navigate('/adminregister')
    }

    const handleAdminLogin = () => {
        navigate('/adminlogin')
    }

    const handleVolLogin = () => {
        navigate('/')
    }

    const handleSubmit = (event) => {
        event.preventDefault();
        if (email === ''){
            setError('Invalid Email')
        }
        else if (password === ''){
            setError('Invalid Password')
        }
        else if (name === ''){
            setError('Invalid Name')
        }
        else if (age === ''){
            setError('Invalid Age')
        }
        else if (address === ''){
            setError('Invalid Address')
        }
        else if (contact === ''){
            setError('Invalid Phone')
        }
        else if (location === ''){
            setError('Invalid Location')
        }
        else if (mon === ''){
            setError('Invalid Monday Availability')
        }
        else if (tues === ''){
            setError('Invalid Tuesday Availability')
        }
        else if (wed === ''){
            setError('Invalid Wednesday Availability')
        }
        else if (thurs === ''){
            setError('Invalid Thursday Availability')
        }
        else if (fri === ''){
            setError('Invalid Friday Availability')
        }
        else if (sat === ''){
            setError('Invalid Saturday Availability')
        }
        else if (sun === ''){
            setError('Invalid Sunday Availability')
        }
        else{
            navigate('/')
        }
    }

    return(
        <div className="login-wrapper" style={{textAlign: 'center', display: 'flex', justifyContent: 'center', backgroundColor: '#CCCCFF', height: '160vh'}}>
            <div style={{ border: '1px solid black', padding: '20px', marginTop: '8%', height: '70%', width: '40%', backgroundColor: 'white', color: 'black'}}>
                <h1>Volunteer Registration</h1>
            <form onSubmit={handleSubmit}>
                <label>
                <p>Email <input type="text" onChange={e => setEmail(e.target.value)} /></p>
                </label>
                <label>
                <p>Password <input type="password" onChange={e => setPassword(e.target.value)} /></p>
                </label>
                <label>
                <p>Name <input type="text" onChange={e => setName(e.target.value)} /></p>
                </label>
                <label>
                <p>Age <input type="number" onChange={e => setAge(e.target.value)} /></p>
                </label>
                <label>
                <p>Address <input type="text" onChange={e => setAddress(e.target.value)} /></p>
                </label>
                <label>
                <p>Phone <input type="number" onChange={e => setPhone(e.target.value)} /></p>
                </label>
                <label>
                <p>Location <input type="text" onChange={e => setLocation(e.target.value)} /></p>
                </label>
                <label>
                    <p>Availability (numbers of hours per day): </p>
                </label>
                <label>
                <p>Monday <input type="number" onChange={e => setMon(e.target.value)} /></p>
                </label>
                <label>
                <p>Tuesday <input type="number" onChange={e => setTues(e.target.value)} /></p>
                </label>
                <label>
                <p>Wednesday <input type="number" onChange={e => setWed(e.target.value)} /></p>
                </label>
                <label>
                <p>Thursday <input type="number" onChange={e => setThurs(e.target.value)} /></p>
                </label>
                <label>
                <p>Friday <input type="number" onChange={e => setFri(e.target.value)} /></p>
                </label>
                <label>
                <p>Saturday <input type="number" onChange={e => setSat(e.target.value)} /></p>
                </label>
                <label>
                <p>Sunday <input type="number" onChange={e => setSun(e.target.value)} /></p>
                </label>
                <div>
                <button type="submit">Submit</button>
                </div>
                {error && <div>{error}</div>}
            </form>

            <br />
            <div className="button-class">
                <button onClick={handleVolLogin}>Volunteer Login</button>
                <br/>
                <button onClick={handleAdminLogin}>Admin Login</button>
                <br />
                <button onClick={handleAdminRegister}>Admin Registration</button>
            </div>
            </div>
        </div>
    );
}
